import React, { Component } from 'react';
import { Grid } from '@material-ui/core'

class Menu extends Component {
    render() {
        return (
            <Grid container direction="row" justify="center">
                <Grid item align="center" xs={12} md={2}>
                    <div>
                        Home
                    </div>
                </Grid>
                <Grid item align="center" xs={12} md={2}>
                    <div>
                        Projects
                    </div>
                </Grid>

                <Grid item align="center" xs={12} md={2}>
                    <div>
                        About Me
                    </div>
                </Grid>
            </Grid>


        )
    }
}

export default Menu;
